import { createApp } from 'vue';
import { createRouter, createWebHistory } from 'vue-router';

import App from './App.vue'; // Vous devriez utiliser le composant App ici

import routes from './route';

const router = createRouter({
  history: createWebHistory(),
  routes,
});

const app = createApp(App); // Utilisez le composant App ici

app.use(router);

app.mount('#app');
